import React from 'react';
import './App.css';

function About() {
    return ( 
        <div className='container'>
            <div className="greet">
                <h1 className='red'>Hey there !</h1>
                <h1 className='green'>I am Krishna</h1>
            </div>
            <div className='row'>
            <div className="col">
                <h2>About me</h2>
                <p>I am a Computer's Science Graduate-2020, <br/> i am intrested in development </p>
            </div>
            </div>
        </div>
    );
}

export default About;
